import React, { useEffect, useState } from "react";
import api from "../../axiosConfig";
import "./UserDashboard.css";
import { useNavigate } from "react-router-dom";
import DashboardHeader from "./DashboardHeader";
import FeedbackTable from "./FeedbackTable"; // ADDED

const UserDashboard = () => {
  const navigate = useNavigate();
  const [feedbacks, setFeedbacks] = useState([]);

  useEffect(() => {
    const token = localStorage.getItem("token");
    if (!token) {
      navigate("/UserLogin");
      return;
    }
    fetchFeedbacks();
  }, []);

  const fetchFeedbacks = async () => {
    try {
      const res = await api.get("Feedback/my-feedbacks");
      setFeedbacks(res.data);
    } catch (err) {
      console.error(err);
    }
  };

  const handleLogout = () => {
    localStorage.removeItem("token");
    navigate("/UserLogin");
  };

  const user = localStorage.getItem("userName");

  return (
    <div className="dashboard-container">
      <DashboardHeader username={user} onLogout={handleLogout} />

      <main className="dashboard-content">
        <h3>All Submitted Feedbacks</h3>

        <div className="table-container">
          {feedbacks.length > 0 ? (
            <FeedbackTable feedbacks={feedbacks} />
          ) : (
            <p>No feedbacks submitted yet.</p>
          )}
        </div>
      </main>
    </div>
  );
};

export default UserDashboard;
